&quot;Finale&quot; is the series finale of the American comedy television series The Office. It serves as the 24th and 25th episodes of the ninth season, and the 200th and 201st episodes of the series overall. The episode was written by series developer and executive producer Greg Daniels and directed by Ken Kwapis, who directed the series' pilot episode. It originally aired on the National Broadcasting Company (NBC) on May 16, 2013.

The seriesÃ¢â‚¬â€presented as if it were a real documentaryÃ¢â‚¬â€depicts the everyday lives of office employees in the Scranton, Pennsylvania, branch of the fictional Dunder Mifflin Paper Company. In the episode, which takes place almost a year after the last episode &quot;A.A.R.M.&quot;, present and past employees of Dunder Mifflin gather for Dwight Schrute (Rainn Wilson) and Angela Martin's (Angela Kinsey) wedding. Dwight chooses Jim Halpert (John Krasinski) to be his best man, but Michael Scott (Steve Carell) shows up and takes his place. In addition, Pam Halpert (Jenna Fischer) and Jim finally decide to pursue Jim's dream of working in sports marketing. Finally, everyone comes together for a final round of interviews and goodbyes.
